import React from "react";

const tahsilat = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <h4>Cari Seçiniz</h4>
          <input type="text" class="form-control" name="cari_id" />
        </div>
      </div>
    </div>
  );
};

export default tahsilat;
